  input: TEXT,F3XN,,"Dear Mr. Koeppen,  On behalf of the Motorola, Inc. Political
    Action Committee, I am hereby submitting this explanatory statement with our 2003
    Year End  Report.  On August 14, 2003 and August 28, 2003, an error in our payroll
    system caused two erroneous deductions from the paycheck of one of our PAC contributors.  Specifically,
    the amount of $915.77 was erroneously deducted from Sankaran Srinivas paycheck
    on each of the aforementioned dates.  The PAC immediately contacted Mr. Srinivas
    and sent him a refund check in the amount of $1,831.54 on September 11, 2003.  However,
    on December 18, 2003, the payroll department electronically credited Mr. Srinivas
    paycheck in the amount of $906.61 to correct the erroneous deductions taken in
    August.  Since a check was not cut from the PAC bank account, the payroll department
    transmitted the electronic credit as a  negative entry  in our monthly payroll
    file.  The PAC contacted Mr. Srinivas on January 7, 2004 to explain the error
    made by our payroll department.  Mr. Srinivas agreed to send the MotPAC a check
    for $906.61 since he received a full refund of the erroneous deductions taken
    in August.  If you have any questions regarding this  Report, please contact me
    at (847) 576-5306.   Respectfully submitted, Bruce Forsberg Motorola, Inc. Political
    Action Committee Treasurer"
